                    'info',
                    'light',
                    'dark',
                ].map((variant) => (
                    <Alert key={variant} variant={variant}>
                        This is a {variant} alertâ€”check it out!
                    </Alert>
                ))}
            </Container>

            <Container>
                <Row>
                    <Col className='text-center'></Col>
                </Row>
            </Container>
        </>
    );
}

